	@RequestMapping("getHotListAndRegionList.do")
	public void getHotListAndRegionList(RegionDto dto,HttpServletResponse response){
		
		
		//楠岃瘉
		Result result = dto.validate();
		if(result.getKey("errorMsg") != null){
			writeJson(result.getValues(), response);
			return;
		}
				
		//鏌ヨ鏁版嵁
		
		BaseResponse br = BaseResponse.getSuccess("鑾峰彇鎴愬姛");
		
		Map<String,Object> all = basRegionService.getHotListAndRegionList();
		br.setObj(all);
		writeJson(br, response);
		
	}
